    constructor(props) {
        super(props);
        this.state = {
            charecter : {}
        }
    }
    componentDidMount (){
        const { match: { params } } = this.props;
        const response = getCharecterById(params.id);
        console.log(response);
    }
    
  render() {
    return (
      <>
        <div className="container-fluid ">
          <div className="row">
            <div className="col-10 mx-auto">
                <h1>hello</h1>
            </div>
          </div>
        </div>
      </>
    );
  }
}
export default CharcterPageComponent;
